syntax = "proto3";
package fanxi;
import "RestfulBaseResponse.proto";

option java_package = "com.fanxi.service.message";
option java_outer_classname = "InitPhoneResponseProto";

message InitPhoneResponse {
   RestfulBaseResponse baseResponse=1;
   string phoneToken=5;
   string txnId=6;
   string url=7;
}




